-- ----------------------------
-- Table structure for `t_account`
-- ----------------------------
DROP TABLE IF EXISTS `t_account`;
CREATE TABLE `t_account` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '帐号id',
  `name` varchar(50) NOT NULL COMMENT '帐号名称',
  `service_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '合作方id',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `nick_name` varchar(50) DEFAULT NULL COMMENT '昵称',
  `password` varchar(32) DEFAULT NULL COMMENT '密码',
  `property` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '属性',
  `real_name` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `id_card` varchar(20) DEFAULT NULL COMMENT '身份证号码',
  `second_password` varchar(50) DEFAULT NULL COMMENT '二级密保',
  `main_logo` varchar(40) DEFAULT NULL,
  `mobile` varchar(20) DEFAULT NULL,
  `sex` char(1) DEFAULT NULL,
  `birthday` datetime DEFAULT NULL,
  `country` varchar(20) DEFAULT NULL,
  `province` varchar(20) DEFAULT NULL,
  `city` varchar(20) DEFAULT NULL,
  `address` varchar(100) DEFAULT NULL,
  `postcode` varchar(10) DEFAULT NULL,
  `favorite_team` varchar(50) DEFAULT NULL,
  `favorite_player` varchar(50) DEFAULT NULL,
  `hobby` varchar(50) DEFAULT NULL,
  `summary` varchar(200) DEFAULT NULL,
  `mood` varchar(100) DEFAULT NULL,
  `reg_ip` varchar(15) DEFAULT NULL,
  `last_login_ip` varchar(128) DEFAULT NULL,
  `last_login_time` datetime DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT '1979-01-01 01:00:00',
  `update_time` datetime DEFAULT NULL,
  `source_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户来源id',
  `fk` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '饭卡',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `idx_account_name` (`name`,`service_id`) USING BTREE,
  KEY `idx_account_email` (`email`) USING BTREE,
  KEY `idx_account_nickname` (`nick_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1483 DEFAULT CHARSET=utf8 COMMENT='账号表';

