DROP TABLE IF EXISTS `t_goods`;
CREATE TABLE `t_goods` (
  `goods_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品id',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '物品名称',
  `type` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '类型',
  `overlying_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '叠加数',
  `privilege_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '每日特权礼包的物品数量',
  `fk` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'fk价',
  `fp` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'fp价',
  `pop` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '声望价',
  `discount` int(10) unsigned NOT NULL DEFAULT '100' COMMENT '折扣',
  `vip_level_limit` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'vip等级限制',
  `level_limit` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '等级限制',
  `is_hot_sell` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '是否是热销商品',
  `is_new_goods` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '是否新品',
  `num_limit` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '拥有的个数限制',
  `num` int(10) NOT NULL DEFAULT '0' COMMENT '现有数量',
  `pull_off` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '是否下架',
  `is_time_limit` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '是否限时',
  `end_time` timestamp NULL DEFAULT '1979-01-01 01:00:00' COMMENT '抢购结束时间',
  `update_time` timestamp NULL DEFAULT '1979-01-01 01:00:00' COMMENT '更新时间',
  `create_time` timestamp NULL DEFAULT '1979-01-01 01:00:00' COMMENT '创建时间',
  `equipment_info` varchar(2048) NOT NULL COMMENT '装备信息',
  `prop_info` varchar(2048) NOT NULL COMMENT '道具信息',
  PRIMARY KEY (`goods_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='物品表';

