-- ----------------------------
-- Table structure for `t_player`
-- ----------------------------
DROP TABLE IF EXISTS `t_player`;
CREATE TABLE `t_player` (
  `player_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `img_id` int(10) NOT NULL DEFAULT '0' COMMENT '图片id',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '球员名称',
  `star_level` int(11) NOT NULL DEFAULT '0' COMMENT '球员星级',
  `exp` int(11) NOT NULL DEFAULT '0' COMMENT '球员经验',
  `pos` int(11) NOT NULL DEFAULT '0' COMMENT '球员位置',
  `pop` int(11) NOT NULL DEFAULT '0' COMMENT '球员声望',
  `block` smallint(6) NOT NULL DEFAULT '0' COMMENT '盖帽',
  `dunk` smallint(6) NOT NULL DEFAULT '0' COMMENT '扣篮',
  `reb` smallint(6) NOT NULL DEFAULT '0' COMMENT '篮板',
  `shootClose` smallint(6) NOT NULL DEFAULT '0' COMMENT '2分近投',
  `shootMid` smallint(6) NOT NULL DEFAULT '0' COMMENT '2分中投',
  `shootLong` smallint(6) NOT NULL DEFAULT '0' COMMENT '3分远投',
  `steal` smallint(6) NOT NULL DEFAULT '0' COMMENT '抢断',
  `control` smallint(6) NOT NULL DEFAULT '0' COMMENT '控球',
  `pass` smallint(6) NOT NULL DEFAULT '0' COMMENT '传球',
  `jump` smallint(6) NOT NULL DEFAULT '0' COMMENT '弹跳',
  `speed` smallint(6) NOT NULL DEFAULT '0' COMMENT '速度',
  `strength` smallint(6) NOT NULL DEFAULT '0' COMMENT '体力',
  `height` smallint(6) NOT NULL DEFAULT '0' COMMENT '身高（厘米）',
  `weight` smallint(6) NOT NULL DEFAULT '0' COMMENT '体重（千克）',
  `description` varchar(255) NOT NULL DEFAULT '0' COMMENT '描述',
  `create_time` timestamp NOT NULL DEFAULT '1979-01-01 00:00:00' COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT '1979-01-01 00:00:00' COMMENT '修改时间',
  `skill` varchar(50) NOT NULL DEFAULT '' COMMENT '技能ids，逗号隔开',
  `scout_info` varchar(1024) NOT NULL DEFAULT '' COMMENT '球员球探市场信息',
  `power` smallint(6) NOT NULL DEFAULT '0',
  `defence` smallint(6) NOT NULL DEFAULT '0',
  PRIMARY KEY (`player_id`),
  UNIQUE KEY `name` (`name`),
  KEY `player_id` (`player_id`)
) ENGINE=InnoDB AUTO_INCREMENT=53 DEFAULT CHARSET=utf8 COMMENT='球员模型';

